import React from 'react';
import PropTypes from 'prop-types';
import NavLink from 'react-router-dom/NavLink';
import Route from 'react-router-dom/Route';
import Switch from 'react-router-dom/Switch';

import AppBar from '@material-ui/core/AppBar';
import Avatar from '@material-ui/core/Avatar';
import Button from '@material-ui/core/Button';
import Divider from '@material-ui/core/Divider';
import Drawer from '@material-ui/core/Drawer';
import IconButton from '@material-ui/core/IconButton';
import List from '@material-ui/core/List';
import ListItem from '@material-ui/core/ListItem';
import ListItemAvatar from '@material-ui/core/ListItemAvatar';
import ListItemIcon from '@material-ui/core/ListItemIcon';
import ListItemText from '@material-ui/core/ListItemText';
import ListSubheader from '@material-ui/core/ListSubheader';
import Menu from '@material-ui/core/Menu';
import MenuItem from '@material-ui/core/MenuItem';
import Paper from '@material-ui/core/Paper';
import Toolbar from '@material-ui/core/Toolbar';
import Typography from '@material-ui/core/Typography';
import Slider from '@material-ui/lab/Slider';
import { withStyles } from '@material-ui/core/styles';

import ActionFeedback from '@material-ui/icons/Feedback';
import ActionHome from '@material-ui/icons/Home';
import ActionSettings from '@material-ui/icons/Settings';
import ActionTurnedIn from '@material-ui/icons/TurnedIn';
import ActionTurnedInNot from '@material-ui/icons/TurnedInNot';
import EditorShowChart from '@material-ui/icons/ShowChart';
import ImagePhotoSizeSelectLarge from '@material-ui/icons/PhotoSizeSelectLarge';
import NavigationClose from '@material-ui/icons/Close';
import MenuIcon from '@material-ui/icons/Menu';

import Home from './Home';
import Character from './Character';
import Statistics from './Statistics';

import DataFile from './data_file';
import * as utils from './utils';

const appDefaultTitle = 'Sanrio Wardrobe';

/**
 * Application root component
 */
class App extends React.Component {
  constructor() {
    super();

    this.state = {
      menuOpened: false, menuDocked: false, thumbnailSize: 120, title: appDefaultTitle, errorObject: null, errorInfo: null,
    };

    this.refSliderThumbnailSize = React.createRef();

    this.setTitle = this.setTitle.bind(this);
    this.clearError = this.clearError.bind(this);
    this.handleMenuOpen = this.handleMenuOpen.bind(this);
    this.handleMenuClick = this.handleMenuClick.bind(this);
    this.handleMenuPinned = this.handleMenuPinned.bind(this);
    this.handleMenuClose = this.handleMenuClose.bind(this);
    this.handleSettingsOpen = this.handleSettingsOpen.bind(this);
    this.handleSettingsClose = this.handleSettingsClose.bind(this);
    this.handleThumbnailSizeChange = this.handleThumbnailSizeChange.bind(this);
    this.menuWidth = 250;
  }

  getChildContext() {
    const { thumbnailSize } = this.state;
    return {
      thumbnailSize,
      setTitle: this.setTitle,
    };
  }

  componentDidCatch(error, info) {
    const { errorObject } = this.state;
    if (!errorObject) this.setState({ errorObject: error, errorInfo: info });
  }

  /**
   * @param {string} title
   * @returns {void}
   */
  setTitle(title) {
    if (title) {
      this.setState({ title });
    } else {
      this.setState({ title: appDefaultTitle });
    }
  }

  clearError() {
    this.setState({ errorObject: null, errorInfo: null });
  }

  handleMenuOpen() {
    this.setState({ menuOpened: true });
  }

  handleMenuPinned() {
    const { menuDocked } = this.state;
    this.setState({ menuDocked: !menuDocked });
  }

  handleMenuClose() {
    this.setState({ menuOpened: false });
  }

  handleMenuClick() {
    const { menuDocked } = this.state;
    this.clearError();
    if (menuDocked) return;
    window.setTimeout(() => this.setState({ menuOpened: false }), 200);
  }

  handleSettingsOpen(ev) {
    this.setState({ menuSettingsAnchorEl: ev.currentTarget });
  }

  handleSettingsClose() {
    this.setState({ menuSettingsAnchorEl: null });
  }

  handleThumbnailSizeChange(event, value) {
    this.setState({ thumbnailSize: value });
  }

  renderAppBar() {
    const {
      menuOpened, menuDocked, title, menuSettingsAnchorEl, thumbnailSize,
    } = this.state;
    return (
      <AppBar position="static">
        <Toolbar>
          {!menuOpened || !menuDocked
            ? <IconButton onClick={this.handleMenuOpen}><MenuIcon /></IconButton>
            : null }
          <div style={{ flexGrow: 1 }}>
            <Typography variant="title">{title}</Typography>
          </div>
          <div>
            <IconButton onClick={this.handleSettingsOpen}><ActionSettings /></IconButton>
            <Menu open={Boolean(menuSettingsAnchorEl)} anchorEl={menuSettingsAnchorEl} anchorOrigin={{ horizontal: 'right', vertical: 'bottom' }} transformOrigin={{ horizontal: 'right', vertical: 'top' }} onClose={this.handleSettingsClose}>
              <MenuItem>
                <ListItemIcon><ImagePhotoSizeSelectLarge /></ListItemIcon>
                <ListItemText>
                  {`Thumbnail size: ${thumbnailSize}`}
                  <Slider ref={this.refSliderThumbnailSize} value={thumbnailSize} min={30} max={360} step={1} onChange={this.handleThumbnailSizeChange} />
                </ListItemText>
              </MenuItem>
              <Divider />
              <MenuItem onClick={utils.openFeedback}>
                <ListItemIcon><ActionFeedback /></ListItemIcon>
                <ListItemText>Feedback</ListItemText>
              </MenuItem>
            </Menu>
          </div>
        </Toolbar>
      </AppBar>
    );
  }

  renderNavLink(to, icon, text) {
    const { classes } = this.props;
    return (
      <ListItem button component={NavLink} to={to} exact onClick={this.handleMenuClick} activeClassName={classes.activeNavLink}>
        <ListItemIcon>{icon}</ListItemIcon>
        <ListItemText>{text}</ListItemText>
      </ListItem>
    );
  }

  renderNavChara(chara) {
    const { classes } = this.props;
    const avatar = chara.picUrl ? <Avatar src={chara.picUrl} /> : <Avatar>{chara.seriesSymbol}</Avatar>;
    return (
      <ListItem button component={NavLink} to={`/chara/${chara.name}`} exact onClick={this.handleMenuClick} activeClassName={classes.activeNavLink}>
        <ListItemAvatar>{avatar}</ListItemAvatar>
        <ListItemText>{chara.getDisplayName()}</ListItemText>
      </ListItem>
    );
  }

  renderDrawer() {
    const { menuOpened, menuDocked } = this.state;
    return (
      <Drawer open={menuOpened} variant={menuDocked ? 'persistent' : 'temporary'} onClose={this.handleMenuClose}>
        <div style={{ width: this.menuWidth, overflowX: 'hidden' }}>
          <Toolbar>
            <div style={{ flexGrow: 1 }} />
            <IconButton onClick={this.handleMenuPinned}>
              {menuDocked ? <ActionTurnedIn color="action" /> : <ActionTurnedInNot color="action" />}
            </IconButton>
            <IconButton onClick={this.handleMenuClose}><NavigationClose color="action" /></IconButton>
          </Toolbar>
          <Divider />
          <List>
            {this.renderNavLink('/', <ActionHome />, 'Home')}
            {this.renderNavLink('/statistics', <EditorShowChart />, 'Statistics')}
          </List>
          <Divider />
          <List subheader={<ListSubheader>Characters</ListSubheader>}>
            {DataFile.all.map((c) => this.renderNavChara(c)) }
          </List>
        </div>
      </Drawer>
    );
  }

  renderError() {
    const { classes } = this.props;
    const { errorObject, errorInfo } = this.state;
    return (
      <Paper className={classes.errorBox}>
        <p>{errorObject.toString()}</p>
        <pre>{errorInfo.componentStack}</pre>
        <Button onClick={this.clearError}>Retry</Button>
        <Button component={NavLink} onClick={this.clearError} to="/">Back to Home</Button>
      </Paper>
    );
  }

  render() {
    const { menuOpened, menuDocked, errorObject } = this.state;
    const { classes } = this.props;
    return (
      <div style={{ marginLeft: menuOpened && menuDocked ? this.menuWidth : 0 }}>
        {this.renderAppBar()}
        {this.renderDrawer()}
        <div className={classes.container}>
          {errorObject ? this.renderError() : (
            <Switch>
              <Route exact path="/" component={Home} />
              <Route path="/chara/:chara/:title?" component={Character} />
              <Route path="/statistics" component={Statistics} />
            </Switch>
          )}
        </div>
      </div>
    );
  }
}
App.propTypes = {
  // eslint-disable-next-line react/forbid-prop-types
  classes: PropTypes.object.isRequired,
};
App.childContextTypes = {
  thumbnailSize: PropTypes.number,
  setTitle: PropTypes.func,
};
export default withStyles((theme) => ({
  container: {
    backgroundColor: theme.palette.background.default,
    padding: theme.spacing.unit,
  },
  errrorBox: {
    border: `2px solid ${theme.palette.error.main}`,
    padding: theme.spacing.unit,
  },
  activeNavLink: {
    backgroundColor: theme.palette.action.selected,
  },
}))(App);

import React from 'react';
import PropTypes from 'prop-types';

import CircularProgress from '@material-ui/core/CircularProgress';
import Grid from '@material-ui/core/Grid';
import TextField from '@material-ui/core/TextField';

import ActionSearch from '@material-ui/icons/Search';

import isEqual from 'lodash/isEqual';
import throttle from 'lodash/throttle';

import ColorSelector from './ColorSelector';
import DataFile from './data_file';
import DetailView from './DetailView';
import Gallery from './Gallery';

import Photo from './photo';
import * as utils from './utils';

class SearchParams {
  constructor() {
    this.clear();
  }

  /** @returns {boolean} */
  isEmpty() {
    if (this.regexps.length) return false;
    if (this.colorIds.length) return false;
    return true;
  }

  clear() {
    this.regexps = [];
    this.colorIds = [];
  }

  /**
   * @param {Photo} photo
   * @returns {boolean}
   */
  match(photo) {
    if (!this.regexps.every((re) => photo.match(re))) return false;
    if (!this.colorIds.every((c) => photo.data.colors.indexOf(c) >= 0)) return false;
    return true;
  }
}

export default class Character extends React.Component {
  constructor() {
    super();
    this.state = { allPhotos: null, photos: [], error: null };
    this.searchParams = new SearchParams();

    this.refColor = React.createRef();
    this.refText = React.createRef();

    this.colorChanged = this.colorChanged.bind(this);
    this.handleSearchIconClick = this.handleSearchIconClick.bind(this);
    this.handleSearchTextChanged = throttle(this.handleSearchTextChanged.bind(this), 500);
    this.handleSearchTextKeyDown = this.handleSearchTextKeyDown.bind(this);
    this.handleSearchTextBlur = this.handleSearchTextBlur.bind(this);
  }

  componentDidMount() {
    this.loadPhotos();
  }

  componentDidUpdate(prevProps) {
    const { match } = this.props;
    const { chara, title } = match.params;
    if (prevProps.match.params.chara !== chara) {
      this.loadPhotos();
    } else if (prevProps.match.params.title !== title) {
      this.updateLightbox(title);
    }
  }

  /**
   * @private
   * @returns {void}
   */
  loadPhotos() {
    const { match } = this.props;
    const { chara } = match.params;
    const { setTitle } = this.context;
    const df = DataFile.findByName(chara);
    setTitle(df.getDisplayName());
    this.setState({
      allPhotos: null,
      photos: [],
    });
    this.loadPhotosAsync();
  }

  async loadPhotosAsync() {
    const { match } = this.props;
    const { chara, title } = match.params;
    try {
      const photos = await Photo.loadPhotos(chara);
      this.setState({
        allPhotos: photos,
        photos,
      });
      this.clearSearch();
      this.updateLightbox(title);
    } catch (err) {
      this.setState({
        error: err,
      });
    }
  }

  /**
   * @private
   * @param {string?} title
   * @returns {void}
   */
  updateLightbox(title) {
    const { photos, chara } = this.state;
    if (title) {
      if (photos) {
        const index = photos.findIndex((p) => title === p.data.title);
        if (index >= 0) {
          this.setState({ index });
        } else {
          utils.getRouterHistory().replace(`/chara/${chara}`);
        }
      }
    } else {
      this.setState({ index: -1 });
    }
  }

  execSearch() {
    const { allPhotos, photos } = this.state;
    if (!allPhotos) return;
    if (this.searchParams.isEmpty()) {
      if (allPhotos !== photos) {
        this.setState({ photos: allPhotos });
      }
    } else {
      const filtered = allPhotos.filter((p) => this.searchParams.match(p));
      if (!isEqual(filtered, photos)) {
        this.setState({ photos: filtered });
      }
    }
  }

  clearSearch() {
    this.searchParams.clear();
    if (this.refText.current) this.refText.current.value = '';
    if (this.refColor.current) this.refColor.current.clear();
  }

  handleSearchIconClick() {
    this.refText.current.focus();
  }

  handleSearchTextChanged() {
    const text = this.refText.current.value;
    const terms = text.split(/[ \u3000]/).filter((t) => t.length > 0); // U+3000 = full width space
    const termsEscaped = terms.map((t) => t.replace(/[-/\\^$*+?.()|[\]{}]/g, '\\$&'));
    const res = termsEscaped.map((te) => new RegExp(te, 'i'));
    this.searchParams.regexps = res;
    this.execSearch();
  }

  handleSearchTextKeyDown(e) {
    switch (e.keyCode) {
      case 13: // Enter
        this.refText.current.blur(); // To hide keyboard on mobile phones
        e.preventDefault();
        break;
      default:
        break;
    }
  }

  handleSearchTextBlur() {
    const text = this.refText.current.value.trim();
    if (text) {
      const { match } = this.props;
      const { chara } = match.params;
      utils.sendGoogleAnalyticsEvent('textsearch', 'blur', `${chara} ${text}`);
    }
  }

  colorChanged(sender) {
    const colors = sender.listActiveIds();
    this.searchParams.colorIds = colors;
    this.execSearch();
  }

  render() {
    const { match } = this.props;
    const { chara } = match.params;
    const {
      error, allPhotos, photos, index,
    } = this.state;
    const message = (allPhotos === null && [<CircularProgress />, `Loading ${chara}...`])
      || (!this.searchParams.isEmpty() && `Displaying ${photos.length} of ${allPhotos.length} items`)
      || null;
    if (error) throw error;
    return (
      <React.Fragment>
        <ColorSelector innerRef={this.refColor} onChanged={this.colorChanged} />
        <Grid container alignItems="flex-end">
          <Grid item>
            <ActionSearch style={{ padding: '0 8px' }} onClick={this.handleSearchIconClick} />
          </Grid>
          <Grid item>
            <TextField inputRef={this.refText} placeholder="Search text" onChange={this.handleSearchTextChanged} onKeyDown={this.handleSearchTextKeyDown} onBlur={this.handleSearchTextBlur} />
          </Grid>
        </Grid>
        {message ? <div>{message}</div> : <div style={{ height: 8 }} /> }
        <Gallery photos={photos} chara={chara} />
        <DetailView chara={chara} photos={photos} index={index} />
      </React.Fragment>
    );
  }
}
Character.propTypes = {
  match: PropTypes.shape({
    params: PropTypes.shape({
      chara: PropTypes.string,
      title: PropTypes.string,
    }),
  }).isRequired,
};
Character.contextTypes = {
  setTitle: PropTypes.func,
};

import red from '@material-ui/core/colors/red';
import pink from '@material-ui/core/colors/pink';
import orange from '@material-ui/core/colors/orange';
import yellow from '@material-ui/core/colors/yellow';
import green from '@material-ui/core/colors/green';
import blue from '@material-ui/core/colors/blue';
import purple from '@material-ui/core/colors/purple';
import brown from '@material-ui/core/colors/brown';
import grey from '@material-ui/core/colors/grey';
import amber from '@material-ui/core/colors/amber';
import common from '@material-ui/core/colors/common';

export class ColorData {
  /**
   * @param {string} id
   * @param {string} name
   * @param {string} value
   * @param {string} dark
   * @param {string} light
   */
  constructor(id, name, value, dark, light) {
    this.id = id;
    this.name = name;
    this.value = value;
    this.dark = dark;
    this.light = light;
  }
}

const RepresentiveColors = {};

RepresentiveColors.all = [
  RepresentiveColors.Red = new ColorData('red', 'Red', red[800], red[500], red[200]),
  RepresentiveColors.Pink = new ColorData('pink', 'Pink', pink[300], pink[500], pink[200]),
  RepresentiveColors.Orange = new ColorData('orange', 'Orange', orange[500], orange[500], orange[200]),
  RepresentiveColors.Yellow = new ColorData('yellow', 'Yellow', yellow[500], yellow[500], yellow[200]),
  RepresentiveColors.Green = new ColorData('green', 'Green', green[500], green[500], green[200]),
  RepresentiveColors.Blue = new ColorData('blue', 'Blue', blue[500], blue[500], blue[200]),
  RepresentiveColors.Purple = new ColorData('purple', 'Purple', purple[500], purple[500], purple[200]),
  RepresentiveColors.Brown = new ColorData('brown', 'Brown', brown[500], brown[500], brown[200]),
  RepresentiveColors.Black = new ColorData('black', 'Black', common.black, grey[800], grey[700]),
  RepresentiveColors.Grey = new ColorData('grey', 'Grey', grey[700], grey[600], grey[500]),
  RepresentiveColors.White = new ColorData('white', 'White', common.white, grey[200], grey[100]),
  RepresentiveColors.Gold = new ColorData('gold', 'Gold', amber[300], amber[500], amber[200]),
  RepresentiveColors.Silver = new ColorData('silver', 'Silver', grey[400], grey[400], grey[300]),
];

const map = {};
RepresentiveColors.all.forEach((c) => {
  map[c.id] = c;
});
RepresentiveColors.findById = (id) => map[id];

export default RepresentiveColors;

import React from 'react';
import PropTypes from 'prop-types';

import Button from '@material-ui/core/Button';
import { withStyles } from '@material-ui/core/styles';

import ContentFilterList from '@material-ui/icons/FilterList';

import clone from 'lodash/clone';

import Colors, { ColorData } from './colors';

const styleBase = {
  margin: '0.2em 0',
  padding: '0.2em 0.5em',
  borderWidth: '0 0 0.25em',
  minWidth: 0,
  textTransform: 'none',
};

class ColorSelector extends React.Component {
  constructor() {
    super();
    this.state = { enabled: false, actives: {} };

    this.start = this.start.bind(this);
    this.toggle = this.toggle.bind(this);
    this.clear = this.clear.bind(this);
  }

  componentDidUpdate(prevProps, prevState) {
    const { enabled, actives } = this.state;
    const { onChanged } = this.props;
    if (prevState.enabled !== enabled || prevState.actives !== actives) {
      if (onChanged) onChanged(this);
    }
  }

  /**
   * @param {ColorItem} c
   * @returns {object}
   */
  styleColor(c) {
    const { actives } = this.state;
    const isActive = actives[c.id];
    const style = clone(styleBase);
    if (isActive) style.color = 'black';
    style.borderStyle = 'solid';
    style.borderColor = isActive ? c.dark : c.light;
    if (isActive) style.backgroundColor = c.light;
    return style;
  }

  /** @returns {void} */
  start() {
    const { enabled } = this.state;
    this.setState({ enabled: !enabled });
  }

  /**
   * @param {object} e Event args
   * @returns {void}
   */
  toggle(e) {
    e.preventDefault();
    const { actives } = this.state;
    const id = e.currentTarget.getAttribute('data');
    const newActives = clone(actives);
    newActives[id] = !actives[id];
    this.setState({ actives: newActives });
  }

  /**
   * @param {?object} e Event args
   * @returns {void}
   */
  clear(e) {
    if (e) e.preventDefault();
    this.setState({ actives: {} });
  }

  /** @returns {string[]} */
  listActiveIds() {
    const { enabled, actives } = this.state;
    const { colors } = this.props;
    if (!enabled) return [];
    return colors.filter((c) => actives[c.id]).map((c) => c.id);
  }

  /** @returns {boolean} */
  isFilterEnabled() {
    const { enabled, actives } = this.state;
    return enabled && Object.values(actives).findIndex((v) => v) >= 0;
  }

  /**
   * @private
   * @returns {React.Node}
   */
  listButtons() {
    const { colors } = this.props;
    return (
      <React.Fragment>
        {colors.map((c) => (
          <Button key={c.name} onClick={this.toggle} data={c.id} style={this.styleColor(c)}>{c.name}</Button>
        ))}
        <Button key="clear" onClick={this.clear} data="" style={styleBase} disabled={!this.isFilterEnabled()}>CLEAR</Button>
      </React.Fragment>
    );
  }

  render() {
    const { classes } = this.props;
    const { enabled } = this.state;
    return (
      <div>
        <Button style={styleBase} onClick={this.start}>
          <ContentFilterList className={classes.leftIcon} />
          Color filter
        </Button>
        {enabled ? this.listButtons() : null}
      </div>
    );
  }
}
ColorSelector.propTypes = {
  // eslint-disable-next-line react/forbid-prop-types
  classes: PropTypes.object.isRequired,
  colors: PropTypes.arrayOf(PropTypes.instanceOf(ColorData)),
  onChanged: PropTypes.func,
};
ColorSelector.defaultProps = {
  colors: Colors.all,
  onChanged: null,
};

export default withStyles((theme) => ({
  leftIcon: {
    marginRight: theme.spacing.unit,
  },
}))(ColorSelector);

export default class DataFile {
  /**
   * @param {string} name File name of data File
   * @param {string} seriesSymbol
   * @param {string} nameJa
   * @param {string} nameEn
   * @param {string} picUrl URL of the image. Use Flickr's Square 150 format.
   */
  constructor(name, seriesSymbol, nameJa, nameEn, picUrl) {
    this.name = name;
    this.seriesSymbol = seriesSymbol;
    this.nameJa = nameJa;
    this.nameEn = nameEn;
    this.picUrl = picUrl;
  }

  /**
   * @returns {string}
   */
  getDisplayName() {
    return `${this.seriesSymbol} ${this.nameJa} (${this.nameEn})`;
  }
}

